import React from 'react';
import Button from "@material-ui/core/Button/Button";
import Dialog from "@material-ui/core/Dialog/Dialog";
import DialogTitle from "@material-ui/core/DialogTitle/DialogTitle";
import DialogContent from "@material-ui/core/DialogContent/DialogContent";
import DialogContentText from "@material-ui/core/DialogContentText/DialogContentText";
import FormControl from "@material-ui/core/FormControl/FormControl";
import TextField from "@material-ui/core/TextField/TextField";
import DialogActions from "@material-ui/core/DialogActions/DialogActions";
import {makeStyles} from "@material-ui/core";
import InputLabel from "@material-ui/core/InputLabel/InputLabel";
import Input from "@material-ui/core/Input/Input";
import Select from "@material-ui/core/Select/Select";
import MenuItem from "@material-ui/core/MenuItem/MenuItem";
import DatePicker from "react-datepicker";


const useStyles = makeStyles((theme) => ({
    formControl: {
        margin: theme.spacing(1),
        minWidth: 120,
    },
    selectEmpty: {
        marginTop: theme.spacing(2),
    },
}));


export default function EmailUs() {

    const classes = useStyles();
    const [open, setOpen] = React.useState(false);

    const handleClickOpen = () => {
        setOpen(true);
    };

    const handleClose = () => {
        setOpen(false);
    };

    return (
    <div>
        <Button variant="outlined" color="primary" onClick={handleClickOpen}>
            Open form dialog
        </Button>
        <Dialog open={open} onClose={handleClose} aria-labelledby="form-dialog-title">
            <DialogTitle id="form-dialog-title">Schedule a tour</DialogTitle>
            <DialogContent>
                <DialogContentText>
                    Is there a particular floor plan you would like to tour?
                </DialogContentText>
                {/*<select>*/}
                {/*/!*<select onChange={this.setFloorPlan}>*!/*/}
                {/*<option>No, Thank you</option>*/}
                {/*<option>1x1(1 bed, 1 bath)</option>*/}
                {/*<option>2x2(2 bed, 2 bath)</option>*/}
                {/*<option>3x3(3 bed, 3 bath)</option>*/}
                {/*<option>4x4(4 bed, 4 bath)</option>*/}
                {/*</select>*/}
                <FormControl className={classes.formControl}>
                    {/*<InputLabel id="demo-simple-select-label">Floor plan name</InputLabel>*/}
                    <Select
                        labelId="demo-simple-select-label"
                        id="demo-simple-select"
                        value={floorPlan}
                        onChange={handleChange}
                    >
                        <MenuItem value={'No, Thank you'}>No, Thank you</MenuItem>
                        <MenuItem value={'1x1(1 bed, 1 bath)'}>1x1(1 bed, 1 bath)</MenuItem>
                        <MenuItem value={'2x2(2 bed, 2 bath)'}>2x2(2 bed, 2 bath)</MenuItem>
                        <MenuItem value={'3x3(3 bed, 3 bath)'}>3x3(3 bed, 3 bath)</MenuItem>
                        <MenuItem value={'4x4(4 bed, 4 bath)'}>4x4(4 bed, 4 bath)</MenuItem>
                    </Select>
                </FormControl>

                <br/>
                <br/>
                <DatePicker
                    // selected={this.state.date}
                    selected={new Date()}
                    // onChange={this.handleChange}
                    minDate={new Date((new Date()).valueOf() + 1000*3600*24)}
                />
                <br/>
                <TextField
                    autoFocus
                    margin="dense"
                    required id="first-name"
                    label="First Name"
                    fullWidth
                />
                <TextField
                    autoFocus
                    margin="dense"
                    required id="last-name"
                    label="Last Name"
                    fullWidth
                />
                <TextField
                    autoFocus
                    margin="dense"
                    required id="email"
                    label="Email Address"
                    type="email"
                    fullWidth
                />
                <TextField
                    autoFocus
                    margin="dense"
                    required id="phone"
                    label="Phone"
                    type="number"
                    fullWidth
                />
            </DialogContent>
            <DialogActions>
                <Button onClick={handleClose} color="primary">
                    Schedule
                </Button>
            </DialogActions>
        </Dialog>
    </div>
);
}
